import styled from 'styled-components'
import Video from '../videos/video.mp4'

const Container = styled.div`
    margin-top: -60px;
    margin-left: 0;
    margin-right: 0;
    background: #f6f1cb;
    display: flex;
    justify-content: center;
    align-items: center;
    padding: 0 30px;
    width: 100%;
    height: 100%;
    position: absolute;
    z-index: 1;
`
const Background = styled.div`
    position: absolute;
    top: 100px;
    right: 0;
    bottom: 0;
    left: 0;
    background: #000000;
    width: 100%;
    height: 100%;
    overflow: hidden;
`
const VideoBg = styled.video`
    width: 100%;
    height: 100%;
    -o-object-fit: cover;
    object-fit: cover;
    background: #232134;
`

const SearchElements = () => {
    return (
        <Container>
            <Background>
            </Background>
        </Container>
    )
}

export default SearchElements
